import os
import sys
import base64
from io import BytesIO


if getattr(sys, 'frozen', False):
    # We're running in a PyInstaller bundle
    bundle_dir = sys._MEIPASS
else:
    # We're running in a normal Python environment
    bundle_dir = os.path.dirname(os.path.abspath(__file__))

# Change the working directory to the directory containing the executable
os.chdir(bundle_dir)

# Now we can run our application code
import tkinter as tk
from PIL import Image, ImageSequence, ImageTk

root = tk.Tk()

root.title("Fish Spinning")

root.geometry("470x470")

# The base64 encoded string of the GIF data
gif_base64 = ""

# Use the base64 encoded gif data instead of the file path
gif_data = "data:image/gif;base64," + gif_base64
gif_file = Image.open(BytesIO(base64.b64decode(gif_data.split(",")[1])))
frames = []
for frame in ImageSequence.Iterator(gif_file):
    photo = ImageTk.PhotoImage(frame)
    frames.append(photo)

gif_label = tk.Label(root)
gif_label.config(image=frames[0])

def update_gif(index):
    gif_label.config(image=frames[index])
    root.after(20, update_gif, (index+1) % len(frames))

gif_label.pack()

root.after(0, update_gif, 1)

root.mainloop()
